  "MISSION_ID": "M058",
  "MISSION_TITLE": "Operation: Iron Grip",
  "OPERATIONAL_BRIEF": "Overseer Thorne has established a tyrannical and exploitative regime within Sector Gamma, leveraging his position to collude with the Crimson Syndicate. His corruption has led to widespread suffering, resource diversion, and a breakdown of legitimate governance. Your primary task is to infiltrate Thorne's primary administrative complex, neutralize his influence, and dismantle his network of illicit operations to restore order and accountability to Sector Gamma.",
  "OBJECTIVES": [
    {
      "OBJECTIVE_ID": "M058_1",
      "DESCRIPTION": "Infiltrate the Gamma Sector Administration Complex, Thorne's fortified headquarters.",
      "STATUS": "ACTIVE"
    },
    {
      "OBJECTIVE_ID": "M058_2",
      "DESCRIPTION": "Locate and secure critical evidence of Thorne's corruption and his ties to the Crimson Syndicate within his private office or secure data servers.",
      "STATUS": "ACTIVE"
    },
    {
      "OBJECTIVE_ID": "M058_3",
      "DESCRIPTION": "Neutralize Overseer Thorne, removing him from power and ending his corrupt reign.",
      "STATUS": "ACTIVE"
    },
    {
      "OBJECTIVE_ID": "M058_4",
      "DESCRIPTION": "Disrupt Thorne's operational network by disabling key communication arrays or destroying illicit resource caches within the complex.",
      "STATUS": "ACTIVE"
    }
  ],
  "SECONDARY_OBJECTIVES": [
    {
      "OBJECTIVE_ID": "M058_S1",
      "DESCRIPTION": "Identify and tag any high-ranking Crimson Syndicate operatives encountered within the complex for future intelligence gathering.",
      "STATUS": "ACTIVE"
    },
    {
      "OBJECTIVE_ID": "M058_S2",
      "DESCRIPTION": "Recover or destroy Thorne's 'Black Book' ledger, detailing his illicit financial transactions.",
      "STATUS": "ACTIVE"
    }
  ],
  "CRITICAL_ASSETS": [
    "Encrypted data drive for evidence extraction.",
    "Access schematics for the Gamma Sector Administration Complex (provided in intel package).",
    "Specialized breaching tools for reinforced access points."
  ],
  "THREAT_ASSESSMENT": [
    "Elite personal guard contingent loyal to Thorne.",
    "Crimson Syndicate enforcers embedded within the complex's security.",
    "Advanced surveillance systems and automated defensive turrets.",
    "Potential for environmental hazards or traps within restricted areas."
  ],
  "INTEL_PACKAGE": {
    "LOCATION_OVERVIEW": "The Gamma Sector Administration Complex is a multi-level fortified structure, featuring a primary administrative tower, a secure data vault, and an underground resource processing facility. Thorne's private office is on the top floor of the administrative tower.",
    "THORNE_PROFILE": "Overseer Thorne is a highly paranoid and ruthless individual, rarely leaving his complex. He is known to have a hidden safe room within his office. He trusts few, but relies heavily on his head of security, Commander Vex, who maintains a strict patrol schedule.",
    "SYNDICATE_TIES": "Crimson Syndicate operatives are known to use the complex's lower levels as a staging ground for resource smuggling, with dedicated access routes and storage areas."
  },
  "EXTRACTION_PROTOCOL": "Upon completion of objectives, proceed to the designated rooftop helipad for VTOL extraction. In case of primary exfil compromise, an emergency extraction beacon will be activated at the complex's secondary sub-level maintenance tunnel exit.",
  "STATUS": "ACTIVE"
}
```

